import React from 'react';
import { Card } from 'antd';
const { Meta } = Card;
const CardMovies = () => {
	return (
		<Card
			hoverable
			style={{ width: 240 }}
			cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
		>
			<Meta title="Name movies" />
		</Card>
	);
};

export default CardMovies;
